        dct:description    "Offisielle fysiske adresser registrert i Matrikkelen.     En offisiell adresse er den fullstendige adressen for en bygning, bygningsdel, bruksenhet, eiendom eller et annet objekt som er registrert med adresse i eiendomsregisteret matrikkelen.    her realisert på husnivå. Det vil si at en bygning med ti leiligheter som alle har offisielle adresser blir representert med ett adresseobjekt, men bruksenhetsnummerene (som identifiserer de ti leilighetene) ligger som egenskaper til adresseobjektet.    Adressen er merket med tilhørighet til postkrets, grunnkrets, valgkrets, tettsted og sokn.  Adresserte bygningsendringer er ikke med i utvalget til dette produktet."@nb ;
