        dct:description             "Representasjonspunkt for adressen. Angir normalt atkomsten til en bygning, bolig eller andre objekter og steder.    Merknad:  Dersom en adresse kun gjelder en bygning med en adresse, plasseres punktet innenfor bygningens omriss like ved inngang /atkomst.  Det samme gjelder dersom det er knyttet flere adresser til flere innganger/atkomster til en bygning. Adressepunktene plasseres like ved de respektive innganger/atkomster innenfor bygningens omriss. For bygg med altangang eller svalgang med atkomst til den enkelte bolig via utvendig atkomsttrapp, plasseres adressepunktet i trapp nærmest terrengnivå    For ubebygde eiendommer verifiseres det at punktet er innenfor teigen og ved atkomst."@nb ;
